CREATE PROCEDURE `ed_ar_slots_schedule_by_day`(
	IN `curr_day` DATETIME
)
BEGIN
	SELECT DISTINCT
		a.id,
		a.created_at,
		a.updated_at,
		a.deleted_at,
		CASE WHEN b.id IS NULL THEN 'open' ELSE b.username END slot_one,
		CASE WHEN c.id IS NULL THEN 'open' ELSE c.username END slot_two,
		CASE WHEN d.id IS NULL THEN 'open' ELSE d.username END slot_three,
		CASE WHEN e.id IS NULL THEN 'open' ELSE e.username END slot_four,
		CASE WHEN f.id IS NULL THEN 'open' ELSE f.username END slot_five,
		CASE WHEN g.id IS NULL THEN 'open' ELSE g.username END slot_six,
		CASE WHEN h.id IS NULL THEN 'open' ELSE h.username END slot_seven,
		CASE WHEN i.id IS NULL THEN 'open' ELSE i.username END slot_eight,
		CASE WHEN j.id IS NULL THEN 'open' ELSE j.username END slot_nine,
		a.`time`,
		curr_day reservation_time
	FROM 
		ed_ar_slots a
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_one' AND DATE(e.reserved_time) = DATE(curr_day)) b ON a.time = b.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_two' AND DATE(e.reserved_time) = DATE(curr_day)) c ON a.time = c.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_three' AND DATE(e.reserved_time) = DATE(curr_day)) d ON a.time = d.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_four' AND DATE(e.reserved_time) = DATE(curr_day)) e ON a.time = e.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_five' AND DATE(e.reserved_time) = DATE(curr_day)) f ON a.time = f.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_six' AND DATE(e.reserved_time) = DATE(curr_day)) g ON a.time = g.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_seven' AND DATE(e.reserved_time) = DATE(curr_day)) h ON a.time = h.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_eight' AND DATE(e.reserved_time) = DATE(curr_day)) i ON a.time = i.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_ar_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_nine' AND DATE(e.reserved_time) = DATE(curr_day)) j ON a.time = j.time
	ORDER BY a.`time`;
END//
