CREATE PROCEDURE `ed_get_available_buses`(in resId varchar(512))
BEGIN
SELECT bus_id, user_id, reserved_time INTO @bus_id, @user_id, @reserved_time FROM ed_reservations WHERE res_uuid = resId;
SELECT 
    vehicle_capacity
INTO @vc FROM
    probase_tbl_bus
WHERE
    id = @bus_id;
SELECT 
    *
FROM
    probase_tbl_bus a
        LEFT JOIN
    (SELECT DISTINCT
        bus_id
    FROM
        ed_reservations
    WHERE
        DATE(reserved_time) = DATE(@reserved_time)
            AND user_id = @user_id) b ON a.id = b.bus_id
WHERE
    a.operator_id = @user_id
        AND a.vehicle_capacity >= @vc
        ##AND a.bus_id <> @bus_id
        AND b.bus_id IS NULL;
END//
