CREATE PROCEDURE `ed_pending_sms_notification`(
	IN `minBefore` VARCHAR(50),
	IN `minAfter` VARCHAR(50),
	IN `minBeforeEntry` VARCHAR(50)
)
BEGIN

	SELECT CAST((FLOOR(1 + RAND( ) * 2147483647)) AS UNSIGNED) id,

		a.id bus_schedule_id, bus_id,

		DATE_ADD(STR_TO_DATE(CONCAT(DATE(a.reserved_time), ' ', a.`time`, ':00'), '%Y-%m-%d %H:%i:%s'), INTERVAL (-1 * minAfter) MINUTE) deactivated_at,
		
		c.mobile msisdn,

		NOW() created_at,

		NOW() updated_at,

		NOW() deleted_at

	FROM ed_reservations a

		LEFT JOIN ed_sms_notifications b ON a.id = b.bus_schedule_id
		LEFT JOIN probase_tbl_users c ON a.user_id = c.id

		WHERE b.id IS NULL AND DATE(a.reserved_time) = DATE(NOW()) AND a.`status` = 'A' AND

		DATE_ADD(STR_TO_DATE(CONCAT(DATE(a.reserved_time), ' ', a.`time`, ':00'), '%Y-%m-%d %H:%i:%s'), INTERVAL (-1 * (minBefore + minBeforeEntry)) MINUTE) <= NOW();

