		LEFT JOIN (SELECT e.*, u.username FROM ed_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_four' AND DATE(e.reserved_time) = DATE(curr_day)) e ON a.time = e.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_five' AND DATE(e.reserved_time) = DATE(curr_day)) f ON a.time = f.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_six' AND DATE(e.reserved_time) = DATE(curr_day)) g ON a.time = g.time
		LEFT JOIN (SELECT e.*, u.username FROM ed_reservations e JOIN probase_tbl_users u ON e.user_id = u.id WHERE e.`status` <> 'C' AND slot = 'slot_seven' AND DATE(e.reserved_time) = DATE(curr_day)) h ON a.time = h.time
