-- Dumping structure for procedure btmms.ed_update_status_on_ar_reservations
DELIMITER //
CREATE PROCEDURE `ed_update_status_on_ar_reservations`()
BEGIN
    DECLARE lateId INT(10);
    DECLARE dt DATETIME;
    DECLARE done BOOLEAN;
    DECLARE curLate  CURSOR FOR 
		SELECT 
			id,
			STR_TO_DATE(CONCAT(DATE(reserved_time), ' ', `time`, ':00'),
					'%Y-%m-%d %H:%i:%s') dt
		FROM
			ed_ar_reservations
		WHERE
			STR_TO_DATE(CONCAT(DATE(reserved_time), ' ', `time`, ':00'), '%Y-%m-%d %H:%i:%s') <= NOW()
			AND DATE(reserved_time) = DATE(NOW())
			AND `status` = 'A';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
	SELECT 
		option_value
	INTO @time_after FROM
		ed_options
	WHERE
		option_name = 'minutes_after_to_allow_sales'
	LIMIT 1;
    OPEN curLate;
    getLate: LOOP
		FETCH curLate INTO lateId, dt;
        IF done THEN 
			LEAVE getLate;
		END IF;
        
        IF DATE_ADD(dt, INTERVAL @time_after MINUTE) <= NOW() THEN
			UPDATE ed_ar_reservations SET `status` = 'DL' WHERE id = lateId;
		END IF;
    END LOOP getLate;
    CLOSE curLate;
END//
DELIMITER ;

