		where date_format(b.entry_date,'%Y-%m-%d')=processDate and b.account=vac_no  ;
		--  insert into debug (message) values ('date_format(b.entry_date','%Y-%m-%d'),'->',processDate and b.account=vac_no );
		end if;


		UPDATE probase_tbl_acgl_bal AS s, (select x.gen_balance clos from probase_tbl_acgl_bal  x
		where date_format(x.entry_date,'%Y-%m-%d')=processDate and x.account=vac_no) AS p
        SET s.closing_bal = p.clos
        WHERE s.account = vac_no;






	END LOOP process;

CLOSE procData;
set finished= 0;

